(function () {
  'use strict';

  // Your code here...
  // change style
  let css=`
  .spinner {
    width: 40px;
    height: 40px;
    background-color: #333;
  
    margin: 100px auto;
    -webkit-animation: sk-rotateplane 1.2s infinite ease-in-out;
    animation: sk-rotateplane 1.2s infinite ease-in-out;
  }
  .gpt-result p{
    padding: 10px 8px 10px 8px;
    border: 0px solid #ccc;
    border-radius: 12px;
    margin-bottom: 10px;
    box-shadow: 0 2px 5px 0 rgba(0, 0, 0, 0.2);
    -webkit-box-shadow: 0 2px 5px 0 rgba(0, 0, 0, 0.2);
  }
  
  @-webkit-keyframes sk-rotateplane {
    0% { -webkit-transform: perspective(120px) }
    50% { -webkit-transform: perspective(120px) rotateY(180deg) }
    100% { -webkit-transform: perspective(120px) rotateY(180deg)  rotateX(180deg) }
  }
  
  @keyframes sk-rotateplane {
    0% { 
      transform: perspective(120px) rotateX(0deg) rotateY(0deg);
      -webkit-transform: perspective(120px) rotateX(0deg) rotateY(0deg) 
    } 50% { 
      transform: perspective(120px) rotateX(-180.1deg) rotateY(0deg);
      -webkit-transform: perspective(120px) rotateX(-180.1deg) rotateY(0deg) 
    } 100% { 
      transform: perspective(120px) rotateX(-180deg) rotateY(-179.9deg);
      -webkit-transform: perspective(120px) rotateX(-180deg) rotateY(-179.9deg);
    }
  }
  .byedu-logo {
    background-color: #f038ff;
    -webkit-box-shadow: 0px 0px 20px 5px rgba(240, 56, 255, 1);
    -moz-box-shadow: 0px 0px 20px 5px rgba(240, 56, 255, 1);
    box-shadow: 0px 0px 20px 5px rgba(240, 56, 255, 1);
    border-radius: 10px;
    -webkit-border-radius: 10px;
  }
  .byedu-logo:hover {
    -webkit-box-shadow: 0px 0px 30px 5px rgba(240, 56, 255, 1);
    -moz-box-shadow: 0px 0px 30px 5px rgba(240, 56, 255, 1);
    box-shadow: 0px 0px 30px 5px rgba(240, 56, 255, 1);
    border-radius: 10px;
    -webkit-border-radius: 10px;
  }
  `
  GM_addStyle(css)

  let logDom = document.createElement('img');
  logDom.src = imgBase64();
  logDom.style.width = "100%";
  logDom.className = "byedu-logo";
  document.getElementById("content_right").insertBefore(
    logDom,
    document.getElementsByTagName("table")[0]
  );

  const searchResult = document.createElement('div');
  searchResult.className = "spinner";
  let gptDom = document.createElement("p");
  searchResult.appendChild(gptDom);
  document.getElementById("content_right").insertBefore(
    searchResult,
    logDom.nextSibling
  );

  //get wd
  const params = new URL(document.location.href).searchParams;
  const wd = params.get('wd');

  //search with chatGPT
  let gptResult = wd;
  GM_xmlhttpRequest({
    method: 'GET',
    url: 'http://localhost:3000/?wd=' + wd,
    headers: {
      'User-agent': 'Mozilla/4.0 (compatible) Greasemonkey',
      'Accept': 'application/atom+xml,application/xml,text/xml',
    },
    onload: function (responseDetails) {
      //result
      if (responseDetails.status === 200) {
        searchResult.className = "gpt-result"
        gptDom.innerText = responseDetails.responseText.trim();
      }
    }
  });



  function imgBase64() {
    return `data:image/png;base64,`
  }
})();